import React from 'react'
import ReactDOM from 'react-dom'

class ThirdApperanceQuestion extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      AppearanceDataFinished: "",
      AppearanceSeriesChoice: "",
      AppearanceEventChoice: ""
    };
    this.AppearanceSeriesChoice = this.setSeriesChoiceData.bind(this)
    this.AppearanceEventChoice = this.setEventChoiceData.bind(this)
  }

  setSeriesChoiceData(event) {
    console.log("Updating ThirdAppearanceQuestion as Series choice")
    const seriesData = event.currentTarget.value
    this.props.characterDataUpdate(seriesData)
    this.setState({
      AppearanceDataFinished: 1,
      AppearanceSeriesChoice: True
      }, () => {console.log(this.state);
    });
  }

  setEventChoiceData(event) {
    console.log("Updating ThirdAppearanceQuestion as Event choice")
    const eventData = event.currentTarget.value
    this.props.characterDataUpdate(eventData)
    this.setState({
      AppearanceDataFinished: 1,
      AppearanceEventChoice: True
      }, () => {console.log(this.state);
    });
  }

  render() {
    return(
      <div>
        <div
          className="FirstQuestionBoxCharacterStyles"
          style={{
            display: this.state.characterStatus
              ? "block"
              : "none"
                }}
          >
          <CardQuestion
            title="Event"
            text="Do you want to search for an event story?"
            />
          <button onClick={this.props.eventChoice}> Choose By Character </button>
        </div>
        <div
          className="FirstQuestionBoxCharacterStyles"
          style={{
            display: this.state.characterStatus
              ? "block"
              : "none"
                }}
          >
          <CardQuestion
            title="Series"
            text="Do you want to search for an event story?"
            />
          <button onClick={this.props.eventChoice}> Choose By Character </button>
        </div>
      </div>
    )
  }
}


export default ThirdApperanceQuestion
